import React, { Component, Fragment, } from "react";
import { Redirect } from "react-router-dom";
// import logo from "../assets/logo.jpg";
// import { Link } from "react-router-dom";

class Registration extends Component {
  constructor(props){
    super(this.props);

    this.state={
      name:this.props.state.name,
      email:this.props.state.email,
      password:this.state.password,
      isAuth:false,
    };
    this.onChange=this.onChange.bind(this);
    this.onChange(e);{
      this.setState({
        [e.target.name]:e.target.value,
      });
    }
    
  
    onSubmit=async(e)=> {
      e.preventDefault();

      const register={
        name:this.state.name,
        email:this.state.email,
        phone:this.state.password,
        
      };
      const body=JSON.stringify(register);
      const token=sessionStorage.getItem("token");
      const config={
        headers:{
          Authorization:`Bearer ${token}`,
          "Content-Type":"application/json",
        },
      }
      console.log(token);
      try{
         const res=await axios.post(
                              `http://localhost:5000/api/v1/public`,body,config
                              );
      sessionStorage.setItem("isAuth",true);
      this.setState({
                    isAuth:true,
                    });
      }catch(error){
                    alert("Sorry Something Wrong!!");
                  }
    }
  };
  render() {
    return (
      <Fragment>
        {this.state.isAuth ?
        ( <Redirect isAuth={this.state.isAuth} to="/user/userprofile"/>
        ):
        (
      <div className="container ">
        <div className="">

          {/* <div className="jumbotron col-md-6 col-sm-5 " id="login-first"></div> */}
          <div className="jumbotron " id="login-second">
            <div className="container">
              <div className="d-flex justify-content-center">
                <div className="card" id="login-card">
                  <div className="card-header">
                    <h3 className="mt-5 sign">Sign Up As User</h3>
                  </div>
                  <div className="card-body">
                    <form>
                      <div className="input-group form-group">
                        <div className="input-group-prepend">
                          <span
                            className="input-group-text"
                            style={{ background: "#ffc312" }}
                          >
                            <i className="fa fa-envelope"></i>
                          </span>
                        </div>
                        <input
                          type="text"
                          className="form-control"
                          placeholder="email"
                          value={this.props.state.email}disabled
                           />
                      </div>
                      <div className="input-group form-group">
                        <div className="input-group-prepend">
                          <span
                            className="input-group-text"
                            style={{ background: "#ffc312" }}
                          >
                            <i className="fa fa-user"></i>
                          </span>
                        </div>
                        <input
                          type="text"
                          className="form-control"
                          placeholder="username"
                          value={this.props.state.email}disabled
                        />
                      </div>
                      <div className="input-group form-group">
                        <div className="input-group-prepend">
                          <span
                            className="input-group-text"
                            style={{ background: "#ffc312" }}
                          >
                            <i className="fa fa-key"></i>
                          </span>
                        </div>
                        <input
                          type="password"
                          className="form-control"
                          placeholder="password"
                        />
                      </div>
                      <div className="input-group form-group">
                        <div className="input-group-prepend">
                          <span
                            className="input-group-text"
                            style={{ background: "#ffc312" }}
                          >
                            <i className="fa fa-key"></i>
                          </span>
                        </div>
                        <input
                          type="password"
                          className="form-control"
                          placeholder="Re-enter password"
                        />
                      </div>
                      <div className="form-group">
                        <input
                          type="submit"
                          value="Register"
                          className="btn float-right login_btn btn-warning btn-block"
                        />
                      </div>
                    </form>
                  </div>
                  <div className="">
                    <div className="d-flex justify-content-center links">
                      Already have an account?<a href="/Login/user">Sign In</a>
                    </div>
                    <div className="d-flex justify-content-center">
                      <a href="/reset">Forgot your password?</a>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
        )
        }
  
      </Fragment>
    );
  }
}
export default Registration;
